import ExpenseItem from './ExpenseItem'

function Expenses(props){

    return <div>
        <ExpenseItem desc={props.items[0].desc} price={props.items[0].price} date={props.items[0].date}></ExpenseItem>
      <ExpenseItem  desc={props.items[1].desc} price={props.items[1].price} date={props.items[1].date}></ExpenseItem>
      <ExpenseItem  desc={props.items[2].desc} price={props.items[2].price} date={props.items[2].date}></ExpenseItem>
    </div>
}
export default Expenses;
